import React from "react";

import "./styles.css";

function Kontext() {
  return (
    <div className="landing-page flex-col-hstart-vstart">
      <div className="ueberschrift flex-row-vcenter-hstart">
        <img
          src="https://firebasestorage.googleapis.com/v0/b/unify-bc2ad.appspot.com/o/n7tmfvxhy7c-101%3A8?alt=media&token=ad564927-5bc2-408d-99b2-9889c6f50592"
          alt="Not Found"
          className="oak-tree"
        />
        <p className="txt-1010">Klimaschutz kann jeder!</p>
      </div>
      <div className="text flex-row-vcenter-hstart">
        <p className="txt-755">
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Facilisi urna
          amet, congue euismod in facilisis erat arcu dictum. Id viverra amet
          dignissim magnis arcu. Risus convallis faucibus non et, lectus
          ultrices libero in ut. Leo ut viverra sapien pretium rutrum vel id
          imperdiet. Rhoncus sed facilisi tellus vel. Pulvinar mauris convallis
          dis libero porttitor nulla. Vel nisl vulputate ut elit egestas morbi.
          Euismod interdum justo, sapien tincidunt elementum sed. Facilisis
          turpis eget nunc malesuada pulvinar risus, diam. Lectus molestie ac
          aliquet habitant. Tempor tempor eget a nibh elementum mi at. In auctor
          nibh auctor massa, gravida sit suspendisse in. In arcu fringilla
          pretium rhoncus sapien. Congue dictum tincidunt sed et. At aliquet
          gravida massa non turpis donec cras posuere lectus. Semper fames nunc
          ullamcorper ultrices libero vitae, molestie est phasellus. Quisque a,
          habitant justo, sed eget mauris. Amet tristique orci, eu lorem mi.
          Mollis pharetra dignissim volutpat consectetur dolor. Commodo ornare
          integer euismod turpis dolor condimentum. Risus, amet fames eu
          vulputate natoque. Consectetur ac sapien suspendisse tellus in
          feugiat. Sed sagittis amet sem massa facilisis. Etiam sem nunc sed
          blandit. Tincidunt et pharetra risus pretium purus, adipiscing diam
          dolor. Vel nullam quis nibh quis amet. Elementum in quam sapien
          viverra magna at nisl velit dignissim. Dictum sed vitae non nisl amet
          cursus sollicitudin. Vitae eget dignissim velit lectus ultricies nisl.
          Donec ac vitae eleifend sed facilisis magna dignissim. Augue pharetra
          commodo urna tortor, vulputate feugiat volutpat sed aliquam. Senectus
          gravida egestas sit et. Risus nibh penatibus integer egestas arcu.
          Ipsum urna nisi, pharetra amet, sem consectetur tortor. Egestas in in
          lectus elementum. Orci, sed ut tempor, ut enim suspendisse faucibus
          ac. Laoreet tellus ipsum pretium volutpat, vitae ipsum. Ultricies
          hendrerit viverra ut morbi ac malesuada.
        </p>
      </div>
    </div>
  );
}

const Begruessung = () => {
  const today = new Date();

  if (today.getHours() <= 10) {
    return <h1>Guten Morgen!</h1>;
  } else if (today.getHours() > 10 && today.getHours() < 18) {
    return <h1>Guten Tag!</h1>;
  } else if (today.getHours() >= 18) {
    return <h1>Guten Abend!</h1>;
  }
};

const LandingPage = () => {
  return (
    <div>
      <Begruessung />
      <Kontext />
    </div>
  );
};

export default LandingPage;
